import { BrowserRouter as Router, Route, Routes, Navigate } from "react-router-dom";
import Header from './Components/Header';
import AddVehicle from './Components/AddVehicle';
import AllVehicle from './Components/AllVehicle';
import UpdateVehicle from './Components/UpdateVehicle';
import VehicleDetail from "./Components/VehicleDetail";
import HomePage from "./Components/HomePage";
import LoginHandle from "./Components/LoginPage";
import Index from "./Components/index";
import Blank from "./Components/Blank";
import UserNav from "./Components/UserNav";
import UVehicles from "./Components/UVehicles";
import VehiDe from "./Components/VehiDe";
import AddUser from "./Components/AddUser";
import AllUser from "./Components/AllUser";
import Register from "./Components/Register";
import { AuthService } from "./Components/AuthService ";

import './App.css';
import './css/bootstrap.min.css';
import './css/style.css';
import './css/side.css';
import './css/vehicle.css';
import './css/animate.min.css';

function App() {
   // Check if user is logged in
   const isLoggedIn = AuthService.isLoggedIn(); // Check if user is logged in
   const userRole = AuthService.getUserRole();
  return (
    <Router>
      <div className="App">
      {isLoggedIn ? (userRole === 'admin' ? <Header /> : null) : (<LoginHandle />)}

        <Routes>
        <Route path="/index:uId"element={isLoggedIn ? (userRole === 'admin' ? <Header /> : <Index />) : ( <Navigate to="/login" /> ) }/>
        <Route
            path="/"
            element={isLoggedIn ? <HomePage /> : <Navigate to="/login" />}
          />
          <Route
            path="/reg"
            element={<Register/>}
          />
          <Route
            path="/Header/:id"
            element={isLoggedIn ? <Header /> : <Navigate to="/login" />}
          />
          <Route
            path="/AddUser"
            element={isLoggedIn ? <AddUser /> : <Navigate to="/login" />}
          />
          <Route
            path="/AllUser"
            element={isLoggedIn ? <AllUser /> : <Navigate to="/login" />}
          />
          <Route
            path="/add"
            element={isLoggedIn ? <AddVehicle /> : <Navigate to="/login" />}
          />
          <Route
            path="/all"
            element={isLoggedIn ? <AllVehicle /> : <Navigate to="/login" />}
          />
          <Route
            path="/update/:id"
            element={isLoggedIn ? <UpdateVehicle /> : <Navigate to="/login" />}
          />
          <Route
            path="/get/:id"
            element={isLoggedIn ? <VehicleDetail /> : <Navigate to="/login" />}
          />
          <Route
            path="/"
            element={isLoggedIn ? <HomePage /> : <Navigate to="/login" />}
          />

          <Route
            path="/index/:uId"
            element={isLoggedIn ? <Index /> : <Navigate to="/login" />}
          />
          <Route
            path="/vehi/:uId"
            element={isLoggedIn ? <UVehicles /> : <Navigate to="/login" />}
          />
          <Route
            path="/book/:id"
            element={isLoggedIn ? <VehiDe /> : <Navigate to="/login" />}
          />


        </Routes>
      </div>
    </Router>
  );
}

export default App;
